  return (
    <div className='App'>
      <BrowserRouter>
      <Header>Simple Employee Management System </Header>
      <Routes>
        <Route path='/' element={<EmployeeList/>}/>
        <Route path='/add' element={<addEmployee/>}/>


      </Routes>
      </BrowserRouter>
      <AppStyle />

    </div>
  );
}

export default App;
